    "ex_align": {                                     "en": "First choose the alignment and afterwards select a reference element!", "de": "Wählen Sie zuerst die Ausrichtung und anschließend ein Referenzelement aus!", "ru": "Сначала выберите выравнивание, а затем выберите опорный элемент!", "pt": "Primeiro escolha o alinhamento e depois selecione um elemento de referência!", "nl": "Kies eerst de uitlijning en selecteer daarna een referentie-element!", "fr": "Choisissez d’abord l’alignement et sélectionnez ensuite un élément de référence !", "it": "Per prima cosa scegli l'allineamento e poi seleziona un elemento di riferimento!", "es": "¡Primero elija la alineación y luego seleccione un elemento de referencia!", "pl": "Najpierw wybierz wyrównanie, a następnie wybierz element odniesienia!", "uk": "Спочатку виберіть вирівнювання, а потім виберіть опорний елемент!", "zh-cn": "首先选择对齐，然后选择参考元素！"},
    "ex_align_help": {                                "en": "You need to select a reference element for aligning. Afterwards, choose each element, which should be aligned the same.", "de": "Zur Ausrichtung müssen Sie zunächst ein Referenzelement auswählen. Anschließend wählen Sie alle Elemente aus, die auf dieselbe Weise ausgerichtet werden sollen.", "ru": "Вам необходимо выбрать опорный элемент для выравнивания. После этого выберите каждый элемент, который должен быть выровнен таким же образом.", "pt": "Você precisa selecionar um elemento de referência para alinhamento. Depois, escolha cada elemento, que deve ser alinhado da mesma forma.", "nl": "U moet een referentie-element selecteren om uit te lijnen. Kies daarna elk element dat hetzelfde uitgelijnd moet worden.", "fr": "Vous devez sélectionner un élément de référence pour l'alignement. Ensuite, choisissez chaque élément qui doit être aligné de la même manière.", "it": "Devi selezionare un elemento di riferimento per l'allineamento. Dopodiché, scegli ogni elemento che deve essere allineato allo stesso modo.", "es": "Debe seleccionar un elemento de referencia para alinear. Luego, elija cada elemento que desee alinear de la misma manera.", "pl": "Musisz wybrać element odniesienia do wyrównania. Następnie wybierz każdy element, który powinien być wyrównany w ten sam sposób.", "uk": "Потрібно вибрати опорний елемент для вирівнювання. Після цього виберіть кожен елемент, який повинен бути вирівняний однаково.", "zh-cn": "您需要选择一个参考元素进行对齐。然后选择每个应对齐的元素。"},
