    "failmsg_no_config": {                            "en": "The adapter is not yet configured! A basic configuration was loaded!", "de": "Der Adapter ist noch nicht konfiguriert! Es wurde eine Basiskonfiguration geladen!", "ru": "Адаптер еще не настроен! Загружена базовая конфигурация!", "pt": "O adaptador ainda não está configurado! Uma configuração básica foi carregada!", "nl": "De adapter is nog niet geconfigureerd! Er is een basisconfiguratie geladen!", "fr": "L'adaptateur n'est pas encore configuré ! Une configuration de base a été chargée !", "it": "L'adattatore non è ancora configurato! È stata caricata una configurazione di base!", "es": "¡El adaptador aún no está configurado! ¡Se cargó una configuración básica!", "pl": "Adapter nie jest jeszcze skonfigurowany! Załadowano podstawową konfigurację!", "uk": "Адаптер ще не налаштований! Завантажено базову конфігурацію!", "zh-cn": "适配器尚未配置！已加载基本配置！"},
