    "failmsg_no_elements": {                          "en": "There are no connectable elements on the surface! <br> A minimum of 2 rectangles or circles are required!", "de": "Es befinden sich keine verbindbaren Elemente auf der Fläche! <br>Es sind mindestens 2 Rechtecke oder Kreise erforderlich!", "ru": "На поверхности нет соединяемых элементов! <br> Требуется минимум 2 прямоугольника или круга!", "pt": "Não há elementos conectáveis na superfície! <br> São necessários no mínimo 2 retângulos ou círculos!", "nl": "Er zijn geen verbindbare elementen op het oppervlak! <br> Minimaal 2 rechthoeken of cirkels zijn vereist!", "fr": "Il n'y a aucun élément connectable sur la surface ! <br>Un minimum de 2 rectangles ou cercles sont requis !", "it": "Non ci sono elementi collegabili sulla superficie! <br> Sono richiesti almeno 2 rettangoli o cerchi!", "es": "¡No hay elementos conectables en la superficie! <br>¡Se requieren un mínimo de 2 rectángulos o círculos!", "pl": "Na powierzchni nie ma żadnych elementów, które można połączyć! <br> Wymagane są co najmniej 2 prostokąty lub okręgi!", "uk": "На поверхні немає сполучних елементів! <br> Необхідно мінімум 2 прямокутники або кола!", "zh-cn": "表面上没有可连接的元素！<br>至少需要 2 个矩形或圆形！"},
