    "failmsg_opening_frame_preview": {                "en": "Opening the URL inside same window will lead into configuration data loss!<br>Canceled!", "de": "Das Öffnen der URL im selben Fenster führt zum Verlust der Konfigurationsdaten!<br>Abgebrochen!", "ru": "Открытие URL-адреса в том же окне приведет к потере данных конфигурации!<br>Отменено!", "pt": "Abrir a URL dentro da mesma janela levará à perda de dados de configuração!<br>Cancelado!", "nl": "Als u de URL in hetzelfde venster opent, gaan de configuratiegegevens verloren!<br>Geannuleerd!", "fr": "L'ouverture de l'URL dans la même fenêtre entraînera une perte de données de configuration !<br>Annulé !", "it": "L'apertura dell'URL all'interno della stessa finestra comporterà la perdita dei dati di configurazione!<br>Annullato!", "es": "¡Abrir la URL dentro de la misma ventana provocará la pérdida de datos de configuración!<br>¡Cancelado!", "pl": "Otwarcie adresu URL w tym samym oknie spowoduje utratę danych konfiguracyjnych!<br>Anulowano!", "uk": "Відкриття URL-адреси в тому самому вікні призведе до втрати конфігураційних даних!<br>Скасовано!", "zh-cn": "在同一窗口内打开 URL 将导致配置数据丢失！<br>已取消！"},
