    "lbl_animate_value_changed": {                    "en": "If the value has changed sign, animate in the other direction (reverse)", "de": "Wenn der Wert das Vorzeichen geändert hat, Animation in die andere Richtung (umgekehrt)", "ru": "Если значение изменило знак, анимировать в другом направлении (обратный)", "pt": "Se o valor mudou de sinal, anime na outra direção (reverso)", "nl": "Als de waarde van teken is veranderd, animeer dan in de andere richting (omgekeerd)", "fr": "Si la valeur a changé de signe, animez dans l'autre sens (inverse)", "it": "Se il valore ha cambiato segno, animare nella direzione opposta (inverso)", "es": "Si el valor ha cambiado de signo, animar en la otra dirección (invertir)", "pl": "Jeśli wartość zmieniła znak, wykonaj animację w przeciwnym kierunku (odwróć)", "uk": "Якщо значення змінило знак, анімуйте в іншому напрямку (у зворотному напрямку)", "zh-cn": "如果值的符号发生了变化，则按另一个方向进行动画（反向）"},
