    "lbl_negative_ds": {                              "en": "Activate this checkbox, if your datapoint delivers the value as a negative value (e.g. -125)! This can be the case, if the datapoint is used for charging and discharging or consumption and grid-feed!", "de": "Aktivieren Sie diese Checkbox, wenn Ihr Datenpunkt einen negativen Wert (z.B. -125) liefert! Dies kann der Fall sein, wenn der Datenpunkt zum Laden und Entladen oder zum Verbrauch und zur Netzeinspeisung genutzt wird!", "ru": "Активируйте этот флажок, если ваша точка данных выдает отрицательное значение (например, -125)! Это может быть в случае, если точка данных используется для зарядки и разрядки или потребления и подачи в сеть!", "pt": "Ative esta caixa de seleção, se seu ponto de dados entregar o valor como um valor negativo (por exemplo, -125)! Este pode ser o caso, se o ponto de dados for usado para carga e descarga ou consumo e alimentação da rede!", "nl": "Activeer dit selectievakje als uw datapunt de waarde als een negatieve waarde levert (bijv. -125)! Dit kan het geval zijn als het datapunt wordt gebruikt voor laden en ontladen of verbruik en netvoeding!", "fr": "Cochez cette case si votre point de données affiche une valeur négative (par exemple, -125) ! Cela peut être le cas si le point de données est utilisé pour la charge et la décharge, ou pour la consommation et l'alimentation du réseau.", "it": "Attiva questa casella di controllo se il tuo punto dati fornisce il valore come valore negativo (ad esempio -125)! Questo può essere il caso se il punto dati viene utilizzato per la carica e la scarica o per il consumo e l'immissione in rete!", "es": "Active esta casilla si su punto de datos proporciona un valor negativo (p. ej., -125). Esto puede ocurrir si el punto de datos se utiliza para carga y descarga, o para consumo e inyección a la red.", "pl": "Aktywuj to pole wyboru, jeśli Twój punkt danych dostarcza wartość jako wartość ujemną (np. -125)! Może tak być, jeśli punkt danych jest używany do ładowania i rozładowywania lub zużycia i zasilania sieciowego!", "uk": "Активуйте цей прапорець, якщо ваша точка даних надає значення як від’ємне значення (наприклад, -125)! Це може бути у випадку, якщо точка даних використовується для зарядки та розрядки або споживання та живлення до мережі!", "zh-cn": "如果您的数据点提供的值为负值（例如 -125），请激活此复选框！如果数据点用于充电和放电或消耗和电网供电，则可能存在这种情况！"},
